import React from "react";
import "./Home.css";

const BoxContainer = () => {
  return (
    <div className="box-container">
      {/* Left side content */}
      <div className="box-left">
        <h1>The Live Shopping Marketplace</h1>
        <p>
          Shop, sell, and connect around the things you love
        
        </p>
        <button>Shop Now</button>
      </div>

      {/* Right side image */}
      <div className="box-right">
        <img src="assets/Hero.png" alt="Live Shopping" />
      </div>


       <div className="box-container reverse">
      {/* Left side image */}
      <div className="box-left">
        <img src="assets/Hero.png" alt="Live Shopping" />
      </div>

      {/* Right side content */}
      <div className="box-right">
        <h1>Interactive Shopping Platform</h1>
        <p>
          Connect with sellers in real time, explore live events,
          and grab exclusive deals instantly. Shop smarter, faster, and more fun!
        </p>
        <button>Join Now</button>
      </div>
    </div>
    </div>


    

  );
};

export default BoxContainer;
